import React from 'react';
import './LastMeasureResult.css';
import moment from 'moment';


const LastMeasureResult = ({measure}) => {
    console.log(measure);
    return(
        <div className="last-measure-result">
            <p>Your last measure:</p>
            <h1>{measure.systolic}/{measure.diastolic}</h1>
            <h1>Pulse - {measure.pulse}</h1>
            <p>{moment(measure.date.toDate().toString()).format('lll')}</p>
        </div>
    );
}

export default LastMeasureResult
